[特徴]<br>
人気の定番商品として進化を続けてきた『Hot　Shot』<br>このモデルはその中でも最も人気を集めた2012年デビューの型をモデルにした復刻モデルです。<br>
背面に配置したスパインチャンネル構造で、荷物を入れてもよれにくい剛性と高い通気性を確保。15インチまでのノート型PCとタブレットスリーブを内蔵し、収納式のウエストベルトを採用。<br>
摩耗しやすいボトム部分には、1680デニールの耐久性の高いナイロン素材を使用しています。<br>
すっきりとした26Lの容量で、アウトドアでも日常でも使いやすい多機能なデイパックです。<br>　 
■フレックスベントのショルダーハーネス<br>
■背面をサポートするパッドつきのエアメッシュとPEシート<br>
■背骨への負担を減らすスパインチャンネル<br>
■収納式ウエストベルト<br>
■バックセイバーボトム<br>
■本体内部にネオプレーンのPC<br>
■ハイドレーションスリーブ<br>
■オーガナイザーつきフロントポケット<br>
